import { Button, Card, CardActionArea, CardActions, CardContent, IconButton, Typography } from '@material-ui/core';
import ShareIcon from '@material-ui/icons/Share';
import { FC } from 'react';

export const Wikipedia: FC = ({}) => {
  return (
    <Card>
      <CardActionArea>
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
            Wikipedia
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
            Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents
            except Antarctica
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Learn more
        </Button>
        <IconButton aria-label="share" style={{ marginLeft: 'auto' }}>
          <ShareIcon />
        </IconButton>
      </CardActions>
    </Card>
  );
};

export async function getServerSideProps(context) {
  const res = fetch(
    'https://en.wikipedia.org/w/api.php?action=query&prop=revisions&titles=Minsk&rvslots=*&rvprop=content&formatversion=2',
  );
  const data = res.json();

  return {
    props: { data },
  };
}
